window.bookSummaryJSON = "<p><b>Gaia Wilson</b></p> <p>I wanted nothing to do with him.</p> <p>His eyes were lifeless. His demeanor cold. His actions too harsh.</p> <p>Ricardo Carter wasn't the kind of man you fell in love with—he was the kind you ran from.</p> <p><b>Ricardo \"Rocco\" Carter</b></p> <p>I wanted everything to do with her.</p> <p>Her eyes were full of life. Her demeanor soft. Her actions thoughtful.</p> <p>Gaia Wilson was the kind of woman you fell in love with—she was the kind you ran toward<b>.</b></p> <p><i>Sinful Enforcer </i>is book six in the Mafia Misfits series and can be enjoyed as a standalone. Intended for mature listeners.</p>"; 
